import React, {useState} from "react";
import {Box, Button, TextField, Typography} from "@mui/material";

const App = () => {
    const [inputText, setInputText] = useState('');
    const [todos, setTodos] = useState([])
    return (
        <Box>
            <TextField
                label="New todos"
                varient="outlined"
                value={inputText}
                onChange={(e) => setInputText(e.target.value)}
            />
            <Button variant="contained" onClick={() => setTodos([...todos, inputText])}>Add</Button>
            {
                todos.map((value, index) => <Typography key={index}>{value}</Typography>)
            }
        </Box>
    );
}

export default App;
